import "./ExpenseDetails.css";

function ExpenseDetails(props) {
  return (
    <div>
      <div className="expense-items">
        <h2>{props.location}</h2>
        <h2>{props.title}</h2>
        <div className="expense-items__price">Rs {props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseDetails;
